import React, { useState } from 'react';
import Header from '../components/Header';
import Footer from '../components/Footer';

const Contact: React.FC = () => {
    const [amount, setAmount] = useState('');
    const [purpose, setPurpose] = useState('');
    const [period, setPeriod] = useState('');
    const [special, setSpecial] = useState('');
    const [submitted, setSubmitted] = useState(false);

    const handleSubmit = (e: React.FormEvent) => {
        e.preventDefault();
        setSubmitted(true);
    };

    // Contact form state
    const [msgName, setMsgName] = useState('');
    const [msgEmail, setMsgEmail] = useState('');
    const [msgMessage, setMsgMessage] = useState('');
    const [msgSent, setMsgSent] = useState(false);

    // Simulate sending email (replace with backend/email service in production)
    const handleMsgSubmit = (e: React.FormEvent) => {
        e.preventDefault();
        setMsgSent(true);
    };

    return (
        <main className="main-content" style={{ minHeight: 'calc(100vh - 120px)', maxWidth: 900, margin: '0 auto', padding: 24 }}>
            <Header
                title="Bsonat Portfolio"
                links={[
                    { name: 'Home', href: '/' },
                    { name: 'Projects', href: '/projects' },
                    { name: 'Contact', href: '/contact' }
                ]}
            />

            {/* Profile and Info Section */}
            <section style={{ display: 'flex', alignItems: 'center', gap: 32, marginBottom: 32, flexWrap: 'wrap' }}>
                <img
                    src="/images/profile.jpeg"
                    alt="Profile"
                    style={{ width: 120, height: 120, borderRadius: '50%', objectFit: 'cover', border: '3px solid #22223b' }}
                />
                <div style={{ flex: 1, minWidth: 220 }}>
                    <h2 style={{ margin: 0, color: '#22223b' }}>Bolaji Onatunde</h2>
                    <div style={{ color: '#4a4e69', fontWeight: 500, margin: '6px 0' }}>Full Stack Developer</div>
                    <div style={{ color: '#444', marginBottom: 6 }}>Lagos, Nigeria</div>
                    <div style={{ color: '#444', marginBottom: 6 }}>Phone: <a href="tel:+2348012345678" style={{ color: '#4a4e69', textDecoration: 'underline' }}>+234 801 234 5678</a></div>
                    <div style={{ color: '#444' }}>Email: <a href="mailto:bolajionatunde@email.com" style={{ color: '#4a4e69', textDecoration: 'underline' }}>bolajionatunde@email.com</a></div>
                </div>
            </section>

            {/* Customer Message Form */}
            <section style={{ marginBottom: 48 }}>
                <h1>Contact Me</h1>
                {msgSent ? (
                    <div style={{ color: 'green', marginTop: 24 }}>
                        Thank you for your message! I will get back to you soon.
                    </div>
                ) : (
                    <form onSubmit={handleMsgSubmit} style={{ display: 'flex', flexDirection: 'column', gap: 16, maxWidth: 500 }}>
                        <label>
                            Your Name
                            <input
                                type="text"
                                value={msgName}
                                onChange={e => setMsgName(e.target.value)}
                                required
                                style={{ width: '100%', padding: 8, marginTop: 4 }}
                            />
                        </label>
                        <label>
                            Your Email
                            <input
                                type="email"
                                value={msgEmail}
                                onChange={e => setMsgEmail(e.target.value)}
                                required
                                style={{ width: '100%', padding: 8, marginTop: 4 }}
                            />
                        </label>
                        <label>
                            Message
                            <textarea
                                value={msgMessage}
                                onChange={e => setMsgMessage(e.target.value)}
                                rows={4}
                                required
                                placeholder="Type your message here..."
                                style={{ width: '100%', padding: 8, marginTop: 4 }}
                            />
                        </label>
                        <button type="submit" style={{ padding: '10px 0', background: '#22223b', color: '#fff', border: 'none', borderRadius: 4, fontWeight: 600 }}>
                            Send Message
                        </button>
                    </form>
                )}
            </section>

            {/* Loan Request Form */}
            <section>
                <h1>Loan Request Form</h1>
                {submitted ? (
                    <div style={{ color: 'green', marginTop: 24 }}>
                        Thank you for your loan request! We will review your application and contact you soon.
                    </div>
                ) : (
                    <form onSubmit={handleSubmit} style={{ display: 'flex', flexDirection: 'column', gap: 16 }}>
                        <label>
                            Loan Amount
                            <input
                                type="number"
                                value={amount}
                                onChange={e => setAmount(e.target.value)}
                                required
                                min="1"
                                style={{ width: '100%', padding: 8, marginTop: 4 }}
                            />
                        </label>
                        <label>
                            Loan Purpose
                            <input
                                type="text"
                                value={purpose}
                                onChange={e => setPurpose(e.target.value)}
                                required
                                style={{ width: '100%', padding: 8, marginTop: 4 }}
                            />
                        </label>
                        <label>
                            Repayment Period (months)
                            <input
                                type="number"
                                value={period}
                                onChange={e => setPeriod(e.target.value)}
                                required
                                min="1"
                                style={{ width: '100%', padding: 8, marginTop: 4 }}
                            />
                        </label>
                        <label>
                            Special Request
                            <textarea
                                value={special}
                                onChange={e => setSpecial(e.target.value)}
                                rows={4}
                                placeholder="Enter any special request or information here..."
                                style={{ width: '100%', padding: 8, marginTop: 4 }}
                            />
                        </label>
                        <button type="submit" style={{ padding: '10px 0', background: '#22223b', color: '#fff', border: 'none', borderRadius: 4, fontWeight: 600 }}>
                            Submit Loan Request
                        </button>
                    </form>
                )}
            </section>

            <Footer />
        </main>
    );
};

export default Contact;
